import './Project.css';
import { useLocation } from 'react-router-dom';
import Header from '../../Components/Header/Header';
import coverImage from 'projectvault\public\images\coverImage.png';

function Project() {
  const { search } = useLocation();
  const queryParams = new URLSearchParams(search);
  const selectedOption1 = queryParams.get('projectId');
  return (
    <>
      <Header/>
      <div className='body-project'>
        <div className='LHS'>
          <img src={coverImage} />
        </div>

      </div>
      <h1>{selectedOption1}</h1>
    </>
  );
}

export default Project;
